import React from "react";

const Contact = () => {
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Contact Me</h1>
      </div>

      <div className="container contact_div">
        <div clasName="row">
          <div className="col-md-6 col-10 mx-auto"></div>
        </div>
      </div>
    </>
  );
};

export default Contact;
